  false,\n\t\"url\": null,\n\t\"notes\": \"This project will support restoration activities
  at Laysan Island. Staff and volunteers continue efforts to eradicate alien invasive
  species such as Indian dropseed (Sporobolus pyramidatus), Bermuda grass (Cynadon
  dactylon), and Indian fleabane (Pluchea indica) by removing the plants and conducting
  post-monitoring and treatment of the sites to prevent reestablishment. Another component
  of the project is native plant propagation and outplanting in areas free of alien
  invasive species. In addition to the habitat restoration, crew members conduct regular
  monitoring on the vertebrate species for population healthand invertebrate species
  for new invasives.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
